import React, { Component } from 'react';



class HeaderSub extends Component {

	render(){
		return(
			<nav class="navbar navbar-dark bg-dark">
				<span class="navbar-text">
					SHOPMATE
				</span>

				<span class="navbar-text">
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}>Women</span>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}>Men</span>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}>Kids</span>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}>Shoes</span>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}>Brands</span>
				</span>

				<span class="navbar-text">
					Search
				</span>

				<span class="navbar-text">
					User
				</span>


			</nav>
		);
	}
}





export default HeaderSub;
